import React from "react";
import chillHop from "../data";

const SongList = () => {
  return (
    <div>
      <ul>
        {chillHop.map((song) => (
          <li key={song.id}>{song.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default SongList;
